We’re so excited to share these great products—all created collaboratively with our partners @outdoorafro. Available online and in selected stores now (link in bio). 

--

@outdoorafro x @enohammocks: Designed by artist and Outdoor Afro leader Leandra Taylor (@seasonal.lee), this hammock was inspired by Outdoor Afro’s Mt. Kilimanjaro Expedition in Tanzania, Africa.

@outdoorafro x @parksproject: Designed by Oakland-based artist Joonbug (@thebugs87) and inspired by the joy found in the outdoors.

@outdoorafro x @smartwool: Designed by artist and Outdoor Afro leader Leandra Taylor (@seasonal.lee), this performance hike sock features responsibly sourced merino wool and Smartwool’s signature 4 DegreeTM elite fit system.
